  background-color: #f0f0f0;
  border-radius: 10px;
  width:300px;
  list-style:none;
  margin:5px;
  display: flex;
`;

var TodoEntry = styled.div`

`;

function Todo(props){
  return <TodoLiContainer>
    <TodoEntry>Opgave: {props.Task}</TodoEntry>
    <TodoEntry>Frist: {props.Due}</TodoEntry>
    </TodoLiContainer >
}

export default Todo
